CREATE SCHEMA IF NOT EXISTS risk_schema;

DROP TABLE IF EXISTS risk_schema.evaluations;

CREATE TABLE risk_schema.evaluations (
       id uuid NOT NULL,
       customer_id uuid NOT NULL,
       calificacion_moodys VARCHAR(20),
       calificacion_pcr VARCHAR(20),
       calificacion_sbs VARCHAR(20),
       creation_timestamp timestamp NOT NULL,
       PRIMARY KEY (id)
);


